import { styles } from "./ContentHead.styles";
import { HouseIcon } from "../../assets/icons/build-an-emergency-fund.svg";

const ContentHead = (): JSX.Element => {
  return <div style={styles.container}>{HouseIcon}</div>;
};

export default ContentHead;
